import React from 'react';
import './topbar.css';


function Topbar() {
    return (
        <div className="topbar">
            <div className="topbarwrapper">
                <div className="topleft">
                <span className="logo"> </span></div>
                <div className="topright">Right</div>
            </div>
        </div>
    )
}

export default Topbar
